import { useEffect, useState } from 'react'

import './App.css';


function App() {
  const [posts, setPosts] = useState([])
  useEffect(() => {
    fetch('https://jsonplaceholder.typicode.com/posts')
      .then(res => res.json())
      .then((data) => {
        setPosts(data)
      })
  }, [])

  return (
    <div>
      {
        posts.map((post) => (
          <div key={post.id}>Post: {post.title}</div>
        ))
      }
    </div>
  );
}

export default App
